Jean &quot;Django&quot; Reinhardt[1][2] (January 23, 1910 - May 16, 1953) was a Gypsy jazz guitarist.

One of the first prominent European jazz musicians, Reinhardt remains one of the most renowned jazz guitarists due to his innovative and distinctive playing. With violinist Stephane Grappelli he cofounded the Quintette du Hot Club de France, described by critic Thom Jurek as &quot;one of the most original bands in the history of recorded jazz.&quot; Reinhardt's most popular compositions have become jazz standards, including &quot;My Sweet&quot;, &quot;Minor Swing&quot;, &quot;Tears&quot;, &quot;Belleville&quot;, &quot;Djangology&quot; and &quot;Nuages&quot; (French for &quot;Clouds&quot;).

Much more info available on: http://en.wikipedia.org/wiki/Django_Reinhardt

